  // #region 1.3
  function idNameConvention(name) {
    const reg = /\w+/gi;
    const myString = name.replace(reg, function(s) {
      return s.toLowerCase();
    });
    return myString.replace(/ /gi, '_');
  }

  function generate_List() {
    const ul = document.createElement('ul');
    bookTitles.forEach(item => {
      const li = document.createElement('li');
      li.innerHTML = item;
      li.id = idNameConvention(item);
      ul.appendChild(li);
    });

    document.body.appendChild(ul);
  }

  generate_List();
  // #endregion 1.3

  // #region 1.4
  const bookDetails = ['Title', 'Language', 'Author'];

  const Book = function(details, info) {
    for (let i = 0; i < details.length; i++) {
      const propName = details[i].toLowerCase();
      this[propName] = info[i];
    }
  };

  function addBook(bookList, book) {
    bookList[idNameConvention(book.title) + '-2'] = book;
  }

  function createLibrary() {
    const library = {};
    const book_Infos = [
      [bookTitles[0], 'English', 'Stephan Covey'],
      [bookTitles[1], 'English', 'George Orwell'],
      [bookTitles[2], 'English', 'D. Michael Abrashoff'],
      [bookTitles[3], 'English', 'Dale Carnegie'],
      [bookTitles[4], 'English', 'Jim Collins'],
      [bookTitles[5], 'English', 'Yuval Noah Harari'],
      [bookTitles[6], 'English', 'Antoine de Saint-ExupÃ©ry'],
      [bookTitles[7], 'English', 'Paulo Coelho'],
      [bookTitles[8], 'English', 'Sun Tzu'],
      [bookTitles[9], 'Turkish', 'Mehmet Ali Bulut'],
    ];

    for (let index = 0; index < book_Infos.length; index++) {
      const b = new Book(bookDetails, book_Infos[index]);
      addBook(library, b);
    }
    return library;
  }

  const bookList = createLibrary();
  // #endregion 1.4

  // #region 1.5
  function generate_List_Vers2(list) {
    const ul = document.createElement('ul');
    for (const [key, value] of Object.entries(list)) {
      const li = document.createElement('li');
      li.id = key;
      li.classList.add('book_item');
      li.style = 'clear:both; margin: 80px 0;';
      const ul_book = document.createElement('ul');
      ul_book.classList.add('details');
      for (const [key_book, value_book] of Object.entries(value)) {
        const li_book = document.createElement('li');
        const heading = document.createElement('h3');
        const sp = document.createElement('span');
        sp.innerText = key_book.charAt(0).toUpperCase() + key_book.slice(1) + ': ';
        heading.innerText = value_book;
        li_book.innerHTML = sp.outerHTML + heading.outerHTML;
        ul_book.appendChild(li_book);
      }
      li.appendChild(ul_book);

      ul.appendChild(li);
    }

    document.body.appendChild(ul);
  }
  generate_List_Vers2(bookList);
  // #endregion 1.5

