  function addCovers() {
    const books = document.getElementsByClassName('book_item');

    for (let a = 0; a < books.length; a++) {
      const cover = document.createElement('img');
      cover.classList.add('cover');
      books[a].insertBefore(cover, books[a].firstChild);
    }

    for (const [key, val] of Object.entries(source_list)) {
      const item = document.getElementById(key + '-2');

      const image = item.getElementsByTagName('img')[0];

      image.src = val;
    }
  }

  addCovers();
